import React, { useState } from 'react';

function Clustering() {
  const [activeAlgorithm, setActiveAlgorithm] = useState('kmeans');

  const algorithms = {
    kmeans: {
      name: 'K-Means Clustering',
      description: 'Partitioning method that divides data into k clusters based on centroids',
      steps: [
        'Initialize k centroids randomly',
        'Assign points to nearest centroid',
        'Update centroid positions',
        'Repeat until convergence'
      ],
      advantages: [
        'Simple and fast',
        'Easy to understand',
        'Works well with large datasets'
      ],
      limitations: [
        'Needs predefined k value',
        'Sensitive to outliers',
        'Assumes spherical clusters'
      ],
      applications: [
        'Customer Segmentation',
        'Image Compression',
        'Document Classification'
      ]
    },
    hierarchical: {
      name: 'Hierarchical Clustering',
      description: 'Creates a tree of clusters using either agglomerative or divisive approach',
      steps: [
        'Start with individual points as clusters',
        'Merge closest clusters',
        'Update distances',
        'Repeat until single cluster'
      ],
      advantages: [
        'No need to specify clusters number',
        'Creates dendrogram visualization',
        'Captures hierarchy of clusters'
      ],
      limitations: [
        'Computationally intensive',
        'Memory intensive',
        'Cannot handle large datasets well'
      ],
      applications: [
        'Phylogenetic Tree Construction',
        'Social Network Analysis',
        'Taxonomy Creation'
      ]
    },
    dbscan: {
      name: 'DBSCAN',
      description: 'Density-based clustering that finds clusters of arbitrary shape',
      steps: [
        'Define epsilon and minPoints',
        'Find core points',
        'Expand clusters',
        'Label noise points'
      ],
      advantages: [
        'No predefined clusters needed',
        'Handles noise well',
        'Finds arbitrary shapes'
      ],
      limitations: [
        'Sensitive to parameters',
        'Struggles with varying densities',
        'Memory intensive'
      ],
      applications: [
        'Spatial Data Analysis',
        'Anomaly Detection',
        'Traffic Pattern Analysis'
      ]
    }
  };

  return (
    <div className="page-container">
      <h1>Clustering <span className="glow-text">Analysis</span></h1>
      <div className="content-wrapper">
        <div className="algorithm-selector">
          {Object.keys(algorithms).map((algoKey) => (
            <button
              key={algoKey}
              className={`algo-button ${activeAlgorithm === algoKey ? 'active' : ''}`}
              onClick={() => setActiveAlgorithm(algoKey)}
              style={{
                animation: `fadeInDown 0.5s ease-out`
              }}
            >
              {algorithms[algoKey].name}
            </button>
          ))}
        </div>

        <div className="algorithm-content">
          <div className="algo-description">
            <h2>{algorithms[activeAlgorithm].name}</h2>
            <p>{algorithms[activeAlgorithm].description}</p>
          </div>

          <div className="content-grid">
            <div className="steps-section">
              <h3>Algorithm Steps</h3>
              <div className="steps-timeline">
                {algorithms[activeAlgorithm].steps.map((step, index) => (
                  <div 
                    key={index}
                    className="step-item"
                    style={{
                      animation: `fadeInLeft ${0.3 + index * 0.1}s ease-out`
                    }}
                  >
                    <div className="step-number">{index + 1}</div>
                    <div className="step-content">{step}</div>
                  </div>
                ))}
              </div>
            </div>

            <div className="characteristics-grid">
              <div className="advantages-section">
                <h3>Advantages</h3>
                <ul>
                  {algorithms[activeAlgorithm].advantages.map((adv, index) => (
                    <li 
                      key={index}
                      style={{
                        animation: `fadeInRight ${0.3 + index * 0.1}s ease-out`
                      }}
                    >
                      {adv}
                    </li>
                  ))}
                </ul>
              </div>

              <div className="limitations-section">
                <h3>Limitations</h3>
                <ul>
                  {algorithms[activeAlgorithm].limitations.map((lim, index) => (
                    <li 
                      key={index}
                      style={{
                        animation: `fadeInRight ${0.4 + index * 0.1}s ease-out`
                      }}
                    >
                      {lim}
                    </li>
                  ))}
                </ul>
              </div>
            </div>

            <div className="applications-section">
              <h3>Real-world Applications</h3>
              <div className="applications-grid">
                {algorithms[activeAlgorithm].applications.map((app, index) => (
                  <div 
                    key={index}
                    className="application-card"
                    style={{
                      animation: `fadeInUp ${0.3 + index * 0.1}s ease-out`
                    }}
                  >
                    {app}
                  </div>
                ))}
              </div>
            </div>
          </div>

          <div className="visualization-section">
            {/* Add interactive clustering visualization component here */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Clustering;
